There are two unstable attributes that can be used to allow a trait bound in a specializing implementation that does not appear in the default implementation. rustc_specialization_trait restricts the implementations of a trait to be "always applicable". Implementing traits annotated with rustc_specialization_trait is unstable, so this should not be used on any stable traits exported from the standard library. Sized is an exception, and can have this attribute because it already cannot be implemented by an impl block. Note : rustc_specialization_trait only prevents incorrect monomorphizations, it does not prevent a type from being coerced between specialized and unspecialized types which can be important when specialization must be applied consistently. See rust-lang/rust#85863 for more details. rustc_unsafe_specialization_marker allows specializing on a trait with no associated items. The attribute is unsafe because lifetime constraints from the implementations of the trait are not considered when specializing. The following example demonstrates a limitation of rustc_unsafe_specialization_marker, the specialized implementation is used for all shared reference types, not just those with 'static lifetime. Because of this, new uses of rustc_unsafe_specialization_marker should be avoided. #[rustc_unsafe_specialization_marker]
trait StaticRef {} impl<T> StaticRef for &'static T {} trait DoThing: Sized { fn do_thing(self);
} impl<T> DoThing for T { default fn do_thing(self) { // slow impl }
} impl<T: StaticRef> DoThing for T { fn do_thing(self) { // fast impl }
} rustc_unsafe_specialization_marker exists to allow existing specializations that are based on marker traits exported from std, such as Copy, FusedIterator or Eq.

